import React from "react";
import classes from './SocialIcon.module.css';


const SocialIcon = () => {
  return (
    <React.Fragment>
      <div className={classes.fa}>
        <a href="#" className={classes.facebook}></a>
        {/* <a href="#" className={classes.twitter}></a>
        <a href="#" className={classes.google}></a>
        <a href="#" className={classes.linkedin}></a>
        <a href="#" className={classes.youtube}></a>
        <a href="#" className={classes.instagram}></a> */}
      </div>
    </React.Fragment>
  );
};

export default SocialIcon;
